-- ----------------------------
-- Table structure for `users`
-- ----------------------------
DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `uuid` varchar(32) DEFAULT '' COMMENT 'uuid',
  `type` tinyint(4) DEFAULT '1' COMMENT '1,普通用户:general;2,基金经理:amaldar',
  `email` varchar(255) DEFAULT '' COMMENT '邮箱',
  `mobile` varchar(15) DEFAULT '' COMMENT '手机号',
  `realname` varchar(30) DEFAULT '' COMMENT '真实姓名',
  `id_no` varchar(50) DEFAULT '' COMMENT '证件号码',
  `pwd` varchar(256) DEFAULT '' COMMENT '登录密码',
  `pwd_salt` varchar(256) DEFAULT '' COMMENT '登录密码盐',
  `mention_pwd` varchar(200) DEFAULT '' COMMENT '提币密码',
  `mention_pwd_salt` varchar(200) DEFAULT '' COMMENT '提币密码盐',
  `id_type` tinyint(4) DEFAULT '1' COMMENT '1,身份证:idcard;2,护照:passport',
  `country` tinyint(4) DEFAULT '1' COMMENT '国家地区(目前只有1境内/2境外)两种',
  `source` varchar(255) DEFAULT '' COMMENT '用户来源(注册来源 1pc  2安卓 3ios)',
  `remark` varchar(255) DEFAULT '' COMMENT '注销备注',
  `google_state` tinyint(4) DEFAULT '0' COMMENT '谷歌验证器状态 0,关闭:close;1,开启:open',
  `google_key` varchar(255) DEFAULT '' COMMENT 'google私钥',
  `last_login_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '最后登录时间',
  `state` tinyint(4) DEFAULT '1' COMMENT '1,正常:normal;2,登录冻结:freeze;3,注销:logout',
  `err_count` tinyint(4) unsigned DEFAULT '0' COMMENT '密码输入错误次数',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
  `creator` varchar(50) DEFAULT '' COMMENT '创建人',
  `updator` varchar(50) DEFAULT '' COMMENT '更新人',
  `del_flag` tinyint(4) DEFAULT '0' COMMENT '删除标记 0,否:no;1,是:yes',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_mobile` (`mobile`,`email`) USING BTREE,
  KEY `del_flag` (`del_flag`) USING BTREE,
  KEY `state` (`state`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='用户表';

-- ----------------------------
-- Records of users
-- ----------------------------

